/**
 * 
 * @author tmyers
 * 
 *         Each Notification Event Type consists of the following:
 *         <ul>
 *         <li>category: required: A string that is one of:
 *         <ul>
 *         <li>SYSTEM</li>
 *         <li>APPLICATION_ALERT</li>
 *         <li>APPLICATION_STATUS</li>
 *         </ul>
 *         <li>producer: required: A string that is one of:
 *         <ul>
 *         <li>SYSTEM</li>
 *         <li>USER</li>
 *         </ul>
 *         <li>attentionLevel: required: A string that is one of:
 *         <ul>
 *         <li>LOW</li>
 *         <li>MEDIUM</li>
 *         <li>HIGH</li>
 *         </ul>
 *         <li>presentationTypes: required: A list of one or more strings that is one of:
 *         <ul>
 *         <li>EMAIL</li>
 *         <li>MODAL_POPUP</li>
 *         <li>TOAST</li>
 *         <li>BADGE</li>
 *         </ul>
 *         <li>applicationTypes: required: A list of one or more strings that is one of:
 *         <ul>
 *         <li>FUSION</li>
 *         <li>SYNERGY</li>
 *         </ul>
 *         <li>emailTypes: required: A list of zero or more strings that is one of:
 *         <ul>
 *         <li>AT_TIME_OF_EVENT</li>
 *         <li>BI_MONTHLY_NEWS_LETTER</li>
 *         <li>MORNING_EVENING_ALERT_EMAIL</li>
 *         </ul>
 *         <li>name: required: A string that uniquely defines the given notification event type
 *         <li>displayName: required: A string that has the display name for the given notification
 *         event type
 *         <li>templateBody: required: A string that has the email/in-app HTML content body for the
 *         given notification event type
 *         <li>tokenSubstitutionKeys: required: A list of zero or more strings that contain the
 *         token substitution keys for replacing in the template body
 *         <li>emailCannotBeTurnedOff: required: A boolean, if true, means that the user cannot turn
 *         off/disable email notifications for the given notification event type. NOTE: This only
 *         has meaning if one of the <code>presentationTypes</code> values is EMAIL
 *         </ul>
 */
